import React, { Component } from "react";
import Slider from "react-slick";

const SimpleSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    arrows: false,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    //<div className="relative h-auto w-100" >
    <Slider {...settings}>
      <img
        className=" w-screen h-auto w-100 px-[50px] pb-[20px] pt-[20px] display: block"
        src="/banner.png"
        alt=""
      />
      <img
        className="h-auto w-100 px-[50px] pb-[20px] pt-[20px] display: block"
        src="/banner.png"
        alt=""
      />
    </Slider>
    //</div>
  );
};

export default SimpleSlider;
